import{S as s}from"./SubPageHero.e4565634.js";import{o as t,c as a,a as p,F as c,h as e}from"./index.381d5be6.js";const i="/assets/main_img1.ff708c5f.jpg",n="/assets/cutting-Flow.056d760b.png",l="/assets/data1.4fbfaee4.jpg",o="/assets/data2.3ae2a844.jpg",r="/assets/Speed1.aeedbf3e.jpg",m="/assets/Speed2.0f8cb412.jpg",d="/assets/Chatter1.62d7b8a8.jpg",g="/assets/Chatter2.e4681fba.jpg",x="/assets/Broken.e27840a8.jpg",v="/assets/worn_out.491cb595.jpg",b="/assets/s-tool.98a7a0a3.jpg",f="/assets/NC1.f1f0d248.jpg",A="/assets/NC2.79a59bee.jpg",_="/assets/analysis.70a2a5aa.jpg",h="/assets/reference.4746d995.jpg",B="/assets/Spindle.d00f765b.jpg",C="/assets/Monitoring.a678ea8b.jpg",j="/assets/edge1.3a67b419.jpg",y="/assets/edge2.521f5371.jpg",E="/assets/sc1.9342ac46.jpg",u="/assets/sc2.30fe5175.jpg",H="data:image/png;base64,";const F=e('<div class="container mt-20 mx-auto"><section><div class="scs-top-box"><article class="basis-3/6 flex-shrink-0"><div class="M-title"><span>\uC2A4\uB9C8\uD2B8 \uCEE4\uD305</span><h3 class="font-bold pb-6 pt-1">Smart Cutting</h3></div><img src="'+i+'" class="scs-in-img"></article><article class="basis-3/6"><span class="scs-title D-title">\uC2A4\uB9C8\uD2B8 \uCEE4\uD305</span><h3 class="scs-title font-bold pb-6 pt-1 D-title">Smart Cutting</h3><p><strong class="scs-definition-subTitle">\uAC1C\uC694</strong><p class="scs-definition-text">\uC2A4\uB9C8\uD2B8\uCEE4\uD305\uC740 CNC \uAE30\uACC4 \uAC00\uACF5\uC5D0\uC11C \uC0DD\uC0B0\uC131 \uD601\uC2E0\uC744 \uCC3D\uCD9C\uD558\uB294 Digital Transformnation \uC194\uB8E8\uC158\uC785\uB2C8\uB2E4. \uC2A4\uB9C8\uD2B8\uCEE4\uD305\uC740 CNC\uACF5\uC791\uAE30\uACC4\uB85C\uBD80\uD130 \uAC00\uACF5\uC870\uAC74 \uB370\uC774\uD130 \uB4F1\uACFC |oT\uB85C \uAC00\uACF5\uC0C1\uD0DC/\uC7A5\uBE44 \uB370\uC774\uD130\uB97C \uBAA8\uB2C8\uD130\uB9C1\uD558\uC5EC \uB370\uC774\uD130\uBD84\uC11D/\uC9C4\uB2E8/\uCD5C\uC801\uB97C \uC218\uD589\uD558\uACE0, \uB370\uC774\uD130\uD559\uC2B5\uC744\uD1B5\uD574\uC11C \uCD5C\uC801\uC791\uC5C5\uC744 \uC218\uD589\uD558\uB3C4\uB85D \uC7A5\uBE44\uC640 \uACF5\uC815\uC870\uAC74\uC744 \uC81C\uC5B4\uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4</p><br><p class="scs-definition-text">\uB9CE\uC740 \uACE0\uAC1D\uC0AC\uC5D0\uC11C \uC2A4\uB9C8\uD2B8\uCEE4\uD305\uC744 \uC81C\uC870\uD604\uC7A5\uC5D0 \uC801\uC6A9\uD568\uC73C\uB85C\uC368 \uAC00\uACF5 \uBD80\uD558\uAE30\uBC18 \uC774\uC1A1\uC18D\uB3C4 \uC801\uC751\uC81C\uC5B4\uC640 \uACF5\uAD6C\uD30C\uC190\uC778\uC9C0 \uD6C4\uACF5\uAD6C\uC790\uB3D9\uAD50\uD658\uB4F1\uC744 \uD1B5\uD574\uC11C \uC0DD\uC0B0\uC2DC\uAC04 \uB2E8\uCD95\uACFC \uD568\uAED8 \uD488\uC9C8\uD5A5\uC0C1\uC744 \uC774\uB8E8\uC5B4 \uB0C8\uC2B5\uB2C8\uB2E4. \uB610\uD55C \uACE0\uAC1D\uC0AC\uAC00 \uAE30\uC874\uC5D0 \uAD6C\uCD95\uD55C PoP, MES, ERP \uB4F1\uACFC\uB3C4 \uB370\uC774\uD130 \uD638\uD658\uC744 \uC9C0\uC6D0\uD568\uC73C\uB85C\uC368 \uC81C\uC870\uC5C5\uC758 \uB514\uC9C0\uD138 \uC804\uD658\uC744 \uC801\uADF9\uC801\uC73C\uB85C \uC9C0\uC6D0\uD558\uACE0 \uC788\uC2B5\uB2C8\uB2E4.</p><strong class="scs-definition-subTitle"></strong><p class="scs-definition-text"></p></p><h4 class="font-bold mb-3">\uD750\uB984\uB3C4</h4><img src="'+n+'"><article class="scs-tag"><p>\uD30C\uC190\uC9C4\uB2E8</p><p>\uC774\uC1A1\uC18D\uB3C4</p><p>\uAC00\uACF5\uBD80\uD558</p><p>\uCD5C\uC801\uD654</p><p>\uC0C1\uD0DC\uC9C4\uB2E8</p><p>\uBAA8\uB2C8\uD130\uB9C1</p></article></article></div><div class="scs-mid-point"><h4 class="font-bold pb-6 mt-10">\uC8FC\uC694\uAE30\uB2A5</h4><div class="scs-mid-box"><article class="scs-point-text"><div><p class="flex items-center mb-2.5"><span class="dot"></span><strong>\uB370\uC774\uD130\uD559\uC2B5\uC744 \uD1B5\uD55C \uCD5C\uC801\uAC00\uACF5(\uC774\uC1A1\uC18D\uB3C4 \uC801\uC751\uC81C\uC5B4)</strong></p><p class="point-explain">\uB370\uC774\uD130\uD559\uC2B5 \uAE30\uBC18\uC73C\uB85C \uAC1C\uC120\uB41C \uB808\uD37C\uB7F0\uC2A4\uB370\uC774\uD130(Reference data)\uC0DD\uC131 </p><p class="point-explain">\uC801\uC6A9\uC0AC\uB840\uC5D0\uC11C \uB808\uD37C\uB7F0\uC2A4\uB370\uC774\uD130 \uC801\uC6A9\uD6C4 \uAC00\uACF5\uC2DC\uAC04 11.5% \uB2E8\uCD95, \uAC00\uACF5\uBD80\uD558 38.2% \uAC10\uC18C, \uC774\uC1A1\uC18D\uB3C4 12.2% \uD5A5\uC0C1</p><img src="'+l+'" class="mt-3.5"><img src="'+o+'"></div></article><article class="scs-point-text"><div><p class="flex items-center mb-2.5"><span class="dot"></span><strong>\uC774\uC1A1\uC18D\uB3C4 \uC801\uC751\uC81C\uC5B4</strong></p><p class="point-explain">\uAC00\uACF5\uBD80\uD558\uB97C \uCD5C\uC801 \uBC94\uC704 \uB0B4\uC5D0\uC11C \uC720\uC9C0\uD558\uB3C4\uB85D \uC774\uC1A1\uC18D\uB3C4\uB97C \uC801\uC751\uC81C\uC5B4 </p><p class="point-explain">\uACFC\uBD80\uD558 \uAD6C\uAC04\uC5D0\uC11C \uC774\uC1A1\uC18D\uB3C4 \uAC10\uC18C\uB97C \uD1B5\uD55C \uAC00\uACF5\uBD80\uD558 \uC800\uAC10 \uB4F1 \uAC00\uACF5\uD488\uC9C8 \uD5A5\uC0C1</p><p class="point-explain">\uC800\uBD80\uD558 \uAD6C\uAC04\uC5D0\uC11C \uC774\uC1A1\uC18D\uB3C4 \uC99D\uAC00\uB97C \uD1B5\uD55C \uAC00\uACF5\uC2DC\uAC04 \uB2E8\uCD95\uACFC \uC0DD\uC0B0\uC131 \uD5A5\uC0F9</p><img src="'+r+'" class="my-3.5"><img src="'+m+'"></div></article><article class="scs-point-text"><div><p class="flex items-center mb-2.5"><span class="dot"></span><strong>\uCC44\uD130(Chatter)\uC9C4\uB2E8 \uBC0F \uC81C\uAC70</strong></p><p class="point-explain">\uAC00\uACF5 \uC911\uC5D0 \uCC44\uD130\uAC00 \uBC1C\uC0DD\uD560 \uB54C \uC9C4\uB3D9\uD14C\uC774\uD130\uC640 \uCEE4\uD305\uB2E4\uC774\uB098\uBBF9\uC2A4 \uAE30\uBC18\uC758 \uCC44\uD130 \uC9C4\uB2E8\uACFC \uCD5C\uC801RPM\uC73C\uB85C \uC81C\uC5B4\uD558\uC5EC \uCC44\uD130\uC81C\uAC70 \uBC0F \uAC00\uACF5\uD488\uC9C8 \uD5A5\uC0C1 </p><img src="'+d+'" class="my-3.5"><img src="'+g+'"></div></article><article class="scs-point-text"><div><p class="flex items-center mb-2.5"><span class="dot"></span><strong>\uACF5\uAD6C\uD30C\uC190 \uAC80\uCD9C</strong></p><p class="point-explain">\uAC00\uACF5\uBD80\uD558 \uB370\uC774\uD130\uC758 \uD328\uD134 \uBE44\uAD50\uB97C \uD1B5\uD574\uC11C \uACF5\uAD6C\uD30C\uC190\uC744 \uAC80\uCD9C </p><p class="point-explain">\uAC00\uACF5\uBD80\uD558 \uC815\uC0C1\uAC00\uACF5\uBD80\uD558 \uBC94\uC704\uB97C \uBC97\uC5B4\uB098\uB294 \uACBD\uC6B0 \uACF5\uAD6C\uD30C\uC190 \uC54C\uB78C </p><img src="'+x+'" class="my-3.5"></div></article><article class="scs-point-text"><div><p class="flex items-center mb-2.5"><span class="dot"></span><strong>\uACF5\uAD6C\uB9C8\uBAA8 \uAC80\uCD9C</strong></p><p class="point-explain">\uAC00\uACF5\uBD80\uD558 \uB370\uC774\uD130 \uD559\uC2B5\uC744 \uD1B5\uD574\uC11C \uACF5\uAD6C\uB9C8\uBAA8\uB97C \uC9C4\uB2E8 </p><p class="point-explain">\uACF5\uAD6C\uBCC4 \uC218\uBA85 \uC0C1\uD55C \uB808\uD37C\uB7F0\uC2A4\uB97C \uC0B0\uCD9C \uBC0F \uACF5\uAD6C\uC218\uBA85 \uC608\uCE21 </p><p class="point-explain">\uACF5\uAD6C\uBCC4 \uC801\uC815\uD55C \uACF5\uAD6C\uAD50\uD658 \uC2DC\uC810\uC744\uC81C\uACF5 </p><img src="'+v+'" class="my-3.5"></div></article><article class="scs-point-text"><div><p class="flex items-center mb-2.5"><span class="dot"></span><strong>\uC18C\uACBD\uACF5\uAD6C \uD30C\uC190 \uAC80\uCD9C</strong></p><p class="point-explain">\uC18C\uACBD\uACF5\uAD6C(\u22051mm \uC774\uD558)\uC758 \uD30C\uC190\uC744 \uC2E4\uC2DC\uAC04 \uAC80\uCD9C\uD558\uC5EC \uC54C\uB78C \uBC0F \uC790\uB3D9 Feed-hold\uB97C \uD558\uBA70, \uD30C\uC190 \uC704\uCE58\uB97C \uAE30\uC5B5\uD558\uC5EC \uC7AC\uAC00\uACF5 \uC2DC \uACF5\uAD6C\uC758 \uAC00\uACF5\uC704\uCE58 \uC14B\uD305\uC744 \uC9C0\uC6D0\uD568 </p><img src="'+b+'" class="my-3.5"></div></article><article class="scs-point-text"><div><p class="flex items-center mb-2.5"><span class="dot"></span><strong>NC\uCF54\uB4DC \uCD5C\uC801\uD654</strong></p><p class="point-explain">\uAC00\uACF5\uC774\uB825 \uB370\uC774\uD130\uB97C \uBD84\uC11D\uD558\uC5EC \uAC00\uACF5\uC774\uB825\uB370\uC774\uD130 \uB0B4\uC5D0 \uC788\uB294 \uCC44\uD130\uC640 \uACFC\uBD80\uD558 \uB4F1\uC758 \uBD88\uB7C9\uC791\uC5C5\uC758 \uC6D0\uC778\uC774 \uB41C \uAC00\uACF5\uC870\uAC74\uC758 \uC218\uC815 \uBC0F \uAC00\uACF5\uC2DC\uAC04 \uB2E8\uCD95\uC744 \uC704\uD574 \uC808\uC0AD\uC870\uAC74 \uCD5C\uC801\uD654\uB97C \uC218\uD589\uD558\uB294 NC\uCF54\uB4DC\uB97C \uC0DD\uC131</p><img src="'+f+'" class="my-3.5"><img src="'+A+'"></div></article><article class="scs-point-text"><div><p class="flex items-center mb-2.5"><span class="dot"></span><strong>Data Analysis</strong></p><p class="point-explain">\uAC00\uACF5\uC774\uB825\uB370\uC774\uD130\uB97C \uBD84\uC11D\uD558\uC5EC \uBD88\uB7C9\uBC1C\uC0DD \uC704\uCE58\uC640\uC6D0\uC778 \uB4F1\uC744 \uBD84\uC11D</p><p class="point-explain">\uD488\uC9C8\uBD88\uB7C9\uC774 \uBC1C\uC0DD\uD55C \uAC00\uACF5\uC704\uCE58, \uAC00\uACF5\uC870\uAC74, \uAC00\uACF5\uBD80\uD558 \uB370\uC774\uD130\uC758 \uC0C1\uAD00\uAD00\uACC4\uC5D0 \uAE30\uBC18\uD55C \uC815\uC0C1\uC0C1\uD0DC/\uC774\uC0C1\uC0C1\uD0DC\uB4F1\uC744 \uCD95\uCD9C</p><p class="point-explain">\uACF5\uAD6C\uC218\uBA85 \uC804\uC8FC\uAE30 \uB3D9\uC548 \uC2DC\uACC4\uC5F4\uC5D0 \uB530\uB978 \uAC00\uACF5\uBD80\uD558 \uD328\uD134 \uBC0F \uD234\uCE74\uC6B4\uD2B8 \uCD95\uCD9C</p><img src="'+_+'" class="my-3.5"></div></article><article class="scs-point-text"><div><p class="flex items-center mb-2.5"><span class="dot"></span><strong>Data Reference</strong></p><p class="point-explain">\uC801\uC751\uC81C\uC5B4, \uACF5\uAD6C\uB9C8\uBAA8/\uD30C\uC190 \uC9C4\uB2E8\uC728 \uC704\uD55C reference data \uC0DD\uC131 </p><p class="point-explain">\uACF5\uC0C1\uD0DC/\uACF5\uAD6C\uC0C1\uD0DC \uC9C4\uB2E8\uC744 \uC704\uD55C reference data \uC0DD\uC131</p><p class="point-explain">\uC774\uC1A1\uC18D\uB3C4 \uC801\uC751\uC81C\uC5B4\uC640 \uACF5\uAD6C\uC0C1\uD0DC \uC9C4\uB2E8\uC744 \uB3D9\uC2DC\uC5D0 \uC218\uD589\uD558\uB294 \uCD5C\uC801 reference \uC0DD\uC131</p><img src="'+h+'" class="my-3.5"></div></article><article class="scs-point-text"><div><p class="flex items-center mb-2.5"><span class="dot"></span><strong>\uC2A4\uD540\uB4E4 \uC0C1\uD0DC\uC9C4\uB2E8</strong></p><p class="point-explain">\uC2A4\uD540\uB4E4 \uBAA8\uB4C8\uC758 \uBAA8\uD130,\uBCA0\uC5B4\uB9C1,\uAE30\uC5B4 \uB4F1\uC758 \uC9C4\uB3D9 \uB370\uC774\uD130\uB97C \uBD84\uC11D\uD558\uC5EC \uC2A4\uD540\uB4E4 \uC0C1\uD0DC\uB97C \uC2E4\uC2DC\uAC04\uC73C\uB85C \uBAA8\uB2C8\uD130\uB9C1\uD558\uACE0 \uC7A5\uBE44\uC758 \uACE0\uC7A5 \uBC0F \uC774\uC0C1\uC0C1\uD0DC\uB97C \uC870\uAE30\uC5D0 \uAC10\uC9C0</p><img src="'+B+'" class="my-3.5"></div></article><article class="scs-point-text"><div><p class="flex items-center mb-2.5"><span class="dot"></span><strong>\uAC00\uACF5\uACF5\uC815\uAD00\uB9AC \uBAA8\uB2C8\uD130\uB9C1</strong></p><p class="point-explain">\uC7A5\uBE44 \uAC00\uB3D9\uC0C1\uD0DC\uC758 \uC815\uBCF4\uC640 \uC7A5\uBE44\uBCC4 \uAC00\uACF5\uD69F\uC218, \uAC00\uACF5\uC0C1\uD0DC, \uAC00\uACF5\uC911\uB2E8\uB4F1\uC744 \uAC00\uC2DC\uD654\uD558\uBA70, MES\uC5D0\uC11C \uC0C1\uAE30 \uC815\uBCF4\uB97C \uC0AC\uC6A9\uD560 \uC218 \uC788\uB3C4\uB85D \uB370\uC774\uD130 \uD638\uD658\uC744 \uC9C0\uC6D0</p><img src="'+C+'" class="my-3.5"></div></article></div></div><div class="scs-device"><h4 class="font-bold mt-20 mb-5">\uC5E3\uC9C0 \uB514\uBC14\uC774\uC2A4</h4><div class="scs-mid-box"><article class="scs-point-text"><div><p class="flex items-center mb-2.5"><span class="dot"></span><strong>Cutting Edge(Advance2/4)</strong></p><img src="'+j+'" class="mb-3.5"><p class="point-explain">CNC\uB370\uC774\uD130\uB97C \uC2E4\uC2DC\uAC04 \uBAA8\uB2C8\uD130\uB9C1: \uC2E4\uC81C \uC774\uC1A1\uC18D\uB3C4, \uC2E4\uC81C RPM \uB4F1</p><p class="point-explain">\uC2A4\uD540\uB4E4\uBAA8\uD130,\uC774\uC1A1\uC11C\uBCF4\uBAA8\uD130 \uBD80\uD558\uC758 \uC2E4\uC2DC\uAC04 \uBAA8\uB2C8\uD130\uB9C1</p><p class="point-explain">\uC774\uC1A1\uC18D\uB3C4 \uCD5C\uC801\uD654\uB97C \uC704\uD55C\uC801\uC751\uC81C\uC5B4 (\uC804\uB958\uC13C\uC11C\uC640\uC2A4\uD540\uB458\uB85C\uB4DC \uAE30\uBC18) </p><p class="point-explain">\uACF5\uAD6C \uD30C\uC190 \uAC80\uCD9C \uBC0F \uC9C4\uB2E8: \uC804\uB958\uC13C\uC11C \uAE30\uBC18</p></div></article><article class="scs-point-text"><div><p class="flex items-center mb-2.5"><span class="dot"></span><strong>Cutting Edge(Premium2/4)</strong></p><img src="'+y+'" class="mb-3.5"><p class="point-explain">CNC\uB370\uC774\uD130\uB97C \uC2E4\uC2DC\uAC04 \uBAA8\uB2C8\uD130\uB9C1: \uC2E4\uC81C \uC774\uC1A1\uC18D\uB3C4, \uC2E4\uC81C RPM \uB4F1</p><p class="point-explain">\uC2A4\uD540\uB4E4\uBAA8\uD130/\uC774\uC1A1\uBAA8\uD130 \uBD80\uD558 \uBC0F \uAC00\uACF5\uC0C1\uD0DC\uC758 \uC2E4\uC2DC\uAC04 \uBAA8\uB2C8\uD130\uB9C1</p><p class="point-explain">\uC774\uC1A1\uC18D\uB3C4 \uCD5C\uC801\uD654\uB97C \uC704\uD55C\uC801\uC751\uC81C\uC5B4, \uCC44\uD130 \uAC80\uCD9C \uBC0F \uC81C\uAC70 </p><p class="point-explain">\uACF5\uAD6C\uB9C8\uBAA8 \uC9C4\uB2E8(\uC804\uB958\uC13C\uC11C \uAE30\uBC18) \uBC0F \uC18C\uACBD\uACF5\uAD6C \uD30C\uC190 \uAC80\uCD9C(\uAC00\uC18D\uB3C4\uC13C\uC11C \uAE30\uBC18)</p></div></article></div></div><div class="scs-product"><h4 class="font-bold mt-20 mb-5">\uC81C\uD488\uAD70</h4><div class="scs-mid-box"><article class="scs-point-text"><p class="flex items-center pb-2.5"><span class="dot"></span><strong>Cutting Edge</strong></p><img src="'+E+'" class="my-3.5"></article><article class="scs-point-text"><p class="flex items-center pb-2.5"><span class="dot"></span><strong>\uD559\uC2B5\uC2DC\uC2A4\uD15C &amp; \uB370\uC774\uD130\uD65C\uC6A9 SW</strong></p><img src="'+u+'" class="my-3.5"></article></div></div><div class="card"><img src="'+H+'"><div class="card_in"><p class="phone">\uD504\uB85C\uC81D\uD2B8\uB2F4\uB2F9\uC790</p><p class="name">\uC1A1\uB099\uBA85 <span>\uC804\uB7B5\uAE30\uD68D\uD300 / \uBD80\uC7A5</span></p><p class="phone">010-5054-0122</p><p class="e-mail">spenguin@pineit.co.kr</p></div></div></section></div>',1),R={__name:"SCS",setup(N){return(O,P)=>(t(),a(c,null,[p(s),F],64))}};export{R as default};
